import React, { FC } from 'react';
import './app/styles/App.css';
import HighlitedText from './app/components/HighlightedText';
import Planet from './app/components/Planet';
import SpaceBackground from './app/components/SpaceBackground';

interface planetProps {
  top: number;
  left: number;
  size: number;
  imageSource: string;
}

const planetStyle: planetProps = {
  top: 60,
  left: 75,
  size: 20,
  imageSource: '../assets/images/world.gif',
};

const App: FC = () => {
  return (
    <div>
      <SpaceBackground></SpaceBackground>
      <Planet
        top={planetStyle.top}
        left={planetStyle.left}
        size={planetStyle.size}
        imageSource={planetStyle.imageSource}
      />
      <div className="title-container">
        <HighlitedText> Hello world! </HighlitedText>
        <h1 className="sub-title">
          I'm Twan<span>.</span>
        </h1>
      </div>
    </div>
  );
};

export default App;
